eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   newsData: () => (/* binding */ newsData)\n/* harmony export */ });\nconst newsData = [\n    {\n        id: \"1\",\n        title: \"NASA's Perseverance Rover Discovers Ancient Lake Bed on Mars\",\n        summary: \"The rover has found evidence of what scientists believe was once a lake on the Red Planet's surface.\",\n        content: \"NASA's Perseverance rover has discovered compelling evidence of an ancient lake bed in Mars' Jezero Crater, providing further proof that water once flowed on the Red Planet.\\n\\nThe findings, published in the journal Science Advances, reveal sedimentary rocks and mineral deposits consistent with a long-standing body of water. Scientists estimate this lake existed approximately 3.7 billion years ago.\\n\\n\\\"This is exactly why we chose Jezero Crater as our landing site,\\\" said Ken Farley, Perseverance project scientist at NASA's Jet Propulsion Laboratory. \\\"These findings significantly strengthen the case that this region of Mars once had conditions that could have supported microbial life.\\\"\\n\\nThe rover's specialized instruments detected layered sedimentary rocks and delta formations that typically form in lake environments on Earth. Additionally, the presence of clay minerals suggests prolonged exposure to water.\\n\\nSamples collected from this region are among those being prepared for the future Mars Sample Return mission, which aims to bring Martian material back to Earth for detailed laboratory analysis.\\n\\nThis discovery adds to our growing understanding of Mars' watery past and continues to build evidence that the planet may have once harbored conditions suitable for life.\",\n        imageUrl: \"/placeholder.svg?height=600&width=800\",\n        date: \"2023-07-15\",\n        source: \"NASA\"\n    },\n    {\n        id: \"2\",\n        title: \"SpaceX Successfully Launches 22 More Starlink Satellites\",\n        summary: \"The company continues to expand its internet constellation with another successful deployment.\",\n        content: 'SpaceX successfully launched another batch of 22 Starlink satellites into low Earth orbit on Thursday, further expanding its global internet constellation.\\n\\nThe Falcon 9 rocket lifted off from Cape Canaveral Space Force Station in Florida at 10:30 p.m. EDT. Approximately eight minutes after launch, the first stage booster returned to Earth, landing on the droneship \"Just Read the Instructions\" stationed in the Atlantic Ocean. This marked the booster\\'s twelfth successful flight and recovery.\\n\\n\"Deployment of 22 @Starlink satellites confirmed,\" SpaceX announced on its X (formerly Twitter) account about an hour after launch.\\n\\nWith this latest deployment, SpaceX has now launched more than 5,000 Starlink satellites, though not all remain operational. The constellation provides high-speed, low-latency internet to over 60 countries, with a particular focus on reaching remote and underserved areas.\\n\\nThe company has regulatory approval to deploy up to 12,000 satellites and has applied for permission to eventually launch up to 42,000. This expansion has raised concerns among astronomers about light pollution affecting astronomical observations, though SpaceX has implemented design changes to reduce satellite brightness.\\n\\nThe next Starlink launch is scheduled for early next week from Vandenberg Space Force Base in California.',\n        imageUrl: \"/placeholder.svg?height=600&width=800\",\n        date: \"2023-08-03\",\n        source: \"Space.com\"\n    },\n    {\n        id: \"3\",\n        title: \"James Webb Space Telescope Captures Stunning Image of Distant Galaxy Merger\",\n        summary: \"The powerful telescope reveals unprecedented details of galaxies colliding billions of light-years away.\",\n        content: 'The James Webb Space Telescope (JWST) has captured a breathtaking new image of two galaxies in the process of merging, located approximately 8 billion light-years from Earth.\\n\\nThe image, released today by NASA and the European Space Agency, shows the interacting galaxies with unprecedented clarity and detail. The collision, designated JWST-GM-01, reveals intricate structures including tidal tails, star-forming regions, and gas clouds that had never been observed at this distance before.\\n\\n\"What we\\'re seeing is a cosmic dance that began billions of years ago,\" said Dr. Jane Rigby, Webb Operations Project Scientist at NASA\\'s Goddard Space Flight Center. \"The level of detail in this image is astounding—we can see individual star clusters forming as a result of the merger, something that was impossible to observe at this distance with previous telescopes.\"\\n\\nThe image was captured using Webb\\'s NIRCam (Near-Infrared Camera) and MIRI (Mid-Infrared Instrument), combining data from multiple wavelengths to reveal both the stellar populations and dust distributions in the merging system.\\n\\nAstronomers are particularly excited about the bright regions visible where the galaxies are interacting, which indicate intense bursts of star formation triggered by the collision. These \"starburst\" regions provide valuable insights into how galaxy mergers contribute to stellar birth and galactic evolution.\\n\\n\"This observation demonstrates exactly why we built Webb,\" said Klaus Pontoppidan, Webb project scientist at the Space Telescope Science Institute. \"It\\'s showing us cosmic processes with a level of detail that transforms our understanding of how galaxies grow and evolve throughout the universe\\'s history.\"',\n        imageUrl: \"/placeholder.svg?height=600&width=800\",\n        date: \"2023-09-12\",\n        source: \"NASA\"\n    },\n    {\n        id: \"4\",\n        title: \"Scientists Detect Mysterious Radio Signal from Deep Space\",\n        summary: \"Astronomers have recorded an unusual fast radio burst that challenges current theories.\",\n        content: 'Astronomers using the CHIME radio telescope in Canada have detected a mysterious fast radio burst (FRB) that appears to defy current scientific understanding of these enigmatic cosmic phenomena.\\n\\nThe burst, designated FRB 20230614A, lasted for nearly three seconds—significantly longer than the typical millisecond duration of most FRBs. Even more puzzling, the signal contained a pattern of periodic peaks that repeated approximately every 0.2 seconds.\\n\\n\"This FRB is completely unlike anything we\\'ve seen before,\" said Dr. Sarah Richardson, an astrophysicist at McGill University who led the research. \"The long duration combined with the regular periodic structure suggests a source mechanism that doesn\\'t fit our current models.\"\\n\\nFast radio bursts are intense, brief flashes of radio-frequency emissions that can release as much energy in a millisecond as the Sun does in years. First discovered in 2007, their origins remain largely unknown, though most theories suggest they come from extreme cosmic objects like magnetars—highly magnetized neutron stars.\\n\\nWhat makes FRB 20230614A particularly interesting is its origin. The team has traced it to a galaxy approximately 3 billion light-years away, but surprisingly, the signal appears to be coming from a region with no obvious neutron star or black hole candidate.\\n\\n\"We\\'re possibly looking at a completely new class of astronomical object, or at least a new mechanism for generating FRBs,\" said Dr. Richardson. \"This detection challenges us to expand our thinking about what cosmic objects are capable of producing such powerful radio emissions.\"\\n\\nThe research team is now coordinating with other observatories worldwide to conduct follow-up observations of the source galaxy, hoping to identify what could be generating these unusual signals.',\n        imageUrl: \"/placeholder.svg?height=600&width=800\",\n        date: \"2023-06-30\",\n        source: \"National Geographic\"\n    },\n    {\n        id: \"5\",\n        title: \"European Space Agency Announces New Mission to Jupiter's Moons\",\n        summary: \"The JUICE mission will explore three potentially habitable moons of the gas giant.\",\n        content: 'The European Space Agency (ESA) has officially announced the launch date for its ambitious Jupiter Icy Moons Explorer (JUICE) mission, which will conduct detailed observations of the gas giant Jupiter and three of its largest moons.\\n\\nSet to launch on April 14, 2023, from French Guiana aboard an Ariane 5 rocket, JUICE will embark on an eight-year journey to the Jovian system, arriving in 2031. Once there, it will spend at least three years making detailed observations of Jupiter and its three largest ocean-bearing moons: Ganymede, Callisto, and Europa.\\n\\n\"JUICE represents the culmination of years of scientific planning and technological development,\" said Dr. Günther Hasinger, ESA\\'s Director of Science. \"This mission will fundamentally transform our understanding of the Jupiter system and the potential for habitability around gas giants.\"\\n\\nThe spacecraft will carry ten state-of-the-art instruments, including ice-penetrating radar to map the subsurface of the icy moons, a laser altimeter to study surface topography, and several spectrometers to analyze surface composition and the thin atmospheres of the moons.\\n\\nOf particular interest are the vast subsurface oceans believed to exist beneath the icy crusts of Ganymede, Callisto, and Europa. These liquid water oceans may contain twice as much water as all of Earth\\'s oceans combined and could potentially harbor conditions suitable for some forms of life.\\n\\n\"We know these moons have water, energy sources, and organic compounds—the three basic ingredients needed for life as we know it,\" explained Dr. Carole Mundell, ESA\\'s Director of Science. \"JUICE will help us understand if these moons could potentially support life, which would have profound implications for our search for life beyond Earth.\"\\n\\nAfter its primary mission studying all three moons, JUICE will enter orbit around Ganymede in 2034, becoming the first spacecraft to orbit a moon other than Earth\\'s Moon.',\n        imageUrl: \"/placeholder.svg?height=600&width=800\",\n        date: \"2022-11-22\",\n        source: \"European Space Agency\"\n    },\n    {\n        id: \"6\",\n        title: \"Astronomers Discover Earth-like Planet in Habitable Zone\",\n        summary: \"The newly found exoplanet orbits a star similar to our Sun and could potentially support liquid water.\",\n        content: 'In a significant astronomical discovery, scientists have identified a new Earth-sized exoplanet orbiting within the habitable zone of a Sun-like star, making it one of the most promising candidates yet for potentially supporting life outside our solar system.\\n\\nThe planet, designated Kepler-442g, orbits a G-type star approximately 1,200 light-years from Earth in the constellation Cygnus. It was discovered using data from NASA\\'s Transiting Exoplanet Survey Satellite (TESS) and confirmed through follow-up observations with ground-based telescopes.\\n\\n\"This is one of the most Earth-like planets we\\'ve found to date in terms of both size and the amount of stellar energy it receives,\" said Dr. Elena Mendoza, an astronomer at the Max Planck Institute for Astronomy and lead author of the study published in The Astrophysical Journal. \"Its host star is remarkably similar to our Sun, which makes this discovery particularly exciting.\"\\n\\nKepler-442g has a radius approximately 1.1 times that of Earth and orbits its star every 267 days at a distance that places it comfortably within the habitable zone—the region around a star where conditions might be suitable for liquid water to exist on a planet\\'s surface.\\n\\nInitial spectroscopic observations suggest the planet has an atmosphere, though its exact composition remains unknown. The research team has detected water vapor signatures, which further increases the planet\\'s potential habitability.\\n\\n\"While we can\\'t yet determine if this planet actually has liquid water or is capable of supporting life, it checks all the boxes we look for when searching for potentially habitable worlds,\" explained Dr. Mendoza. \"It\\'s the right size, receives a similar amount of energy as Earth does from the Sun, and appears to have an atmosphere.\"\\n\\nThe James Webb Space Telescope is scheduled to conduct more detailed observations of Kepler-442g\\'s atmosphere next year, which could provide further insights into its potential habitability.',\n        imageUrl: \"/placeholder.svg?height=600&width=800\",\n        date: \"2023-10-05\",\n        source: \"Space.com\"\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./lib/data.ts\n");

